import React from 'react'
import {AiFillLinkedin} from 'react-icons/ai'
import {BsPinterest}from 'react-icons/bs'
import {AiFillGithub}from 'react-icons/ai'
import { BsInstagram } from "react-icons/bs";
import web2 from './../../resm/web2.png'
//import { useRef } from 'react';
import emailjs from '@emailjs/browser';


import './Contact.css'

const senEmail=()=>{
  e.preventDefault();

  emailjs.sendForm('service_pbt1jck', 'template_83j8qhb', form.current, '83VWm2X-LxILFNKY9')
    .then((result) => {
        console.log(result.text);
    }, (error) => {
        console.log(error.text);
    });


};
const Contact = () => {
  return (
    <div className="container">
    
      <h1 className="text-h1" >
      Thank you for your visit
      </h1>
      <h2 className='accounts'>You can follow all new on my following accounts</h2>
      <div >
      <ul className='soiol' >
        <li > <AiFillLinkedin color =" #93C11A"  size="38px" />  
        ALAA ABDALWAHED </li>
        <li> <BsPinterest  color =" #93C11A"  size="38px"  /> 
        ALAA ABDALWAHED</li>
        <li><AiFillGithub  color =" #93C11A"  size="38px" /> 
        
        alaa abdul wahed</li>
        <li> < BsInstagram   color =" #93C11A"  size="35px" /> alaa-abdalwahed </li>
      </ul>
      </div>
      <div>
      <img className='img' src={web2} title ="infographic" alt='' />

      </div>
      <section className='number'>
        <div className='mail'>
          <h3 className='--text-center'>Contact Us </h3>
            <from ref={from} onSubmit ={senEmail}></from>
            <form className='--form-control--card'>
              <input type ="text" placeholder='Full Name' name ='user_name' required/>
              <input type ="email" placeholder='Email' name ='user_email' required/>
              <input type ="text" placeholder='Order' name ='order' required/>
              <button type ="submit" className='--btn--btn-primary'>Send Order</button>
            </form>
          
        </div>
        

      </section>
      
    </div>
  )
}
export default Contact;
